import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './DashboardHome.css';

function DashboardHome() {
  const navigate = useNavigate();
  const [showCitationSubs, setShowCitationSubs] = useState(false);
  const [showAuthorSubs, setShowAuthorSubs] = useState(false);

  return (
    <div className="dashboard-grid">
      <div className="dashboard-card" onClick={() => navigate('/search')}>üîç Search</div>
      <div className="dashboard-card" onClick={() => navigate('/influence')}>üåü Influence</div>

      <div className="dashboard-card expandable" onClick={() => setShowCitationSubs(!showCitationSubs)}>
        üìä Citation
        {showCitationSubs && (
          <div className="sub-card-container">
            <div className="sub-card" onClick={() => navigate('/citation/year')}>üìÖ By Year</div>
          </div>
        )}
      </div>

      <div className="dashboard-card expandable" onClick={() => setShowAuthorSubs(!showAuthorSubs)}>
        üë§ Author
        {showAuthorSubs && (
          <div className="sub-card-container">
            <div className="sub-card" onClick={() => navigate('/author/year')}>üìÖ By Year</div>
            <div className="sub-card" onClick={() => navigate('/author/trajectory')}>üìà Trajectory</div>
          </div>
        )}
      </div>
    </div>
  );
}

export default DashboardHome;
